import styled from "styled-components"
import { Description, Title, Content, Image } from "../components/modules"

const FourthPage = () => {
  return (
    <Background id="4">
      <Image src="images/evolve.png" alt="evolve" />
      <Content>
        <Title>모티는 진화해요</Title>
        <Description>
          모티는 시간이 지남에 따라 모습이 달라져요. <br />총 다섯 단계가
          있으며, 애정도에 따라 다른 모습으로 성장할 거에요. 애정도는 모티와의
          다양한 활동을 통해 상승해요. 모티의 진화는 곧 당신의 성장! 꾸준한
          당신의 성장을 모티가 응원해요.
        </Description>
      </Content>
    </Background>
  )
}

export default FourthPage

const Background = styled.div`
  height: 67vh;
  background: #f0f0f0;
  display: flex;
  align-items: center;
  justify-content: space-evenly;
`
